/**
 * Stores the Figure to a StorableOutput.
 */
public void write(StorableOutput dw) {
    super.write(dw);
    if (fAttributes == null)
        dw.writeString("no_attributes");
    else {
        dw.writeString("attributes");
        fAttributes.write(dw);
    }
}
